import './queues.css';
import axios from 'axios';
import React, { useState, useEffect } from 'react';
import io from 'socket.io-client';

import MedicalServicesIcon from '@mui/icons-material/MedicalServices';
import MonitorHeartIcon from '@mui/icons-material/MonitorHeart';
import VaccinesIcon from '@mui/icons-material/Vaccines';
import ZoomOutMapIcon from '@mui/icons-material/ZoomOutMap';

const Queues = () => {
    const [queue, setQueue] = useState([]);
    const [name, setName] = useState('');
    const [uniqueNumber, setUniqueNumber] = useState('');

    useEffect(() => {
        const apiUrl = 'http://localhost:3001/main-table/receptionQueue';
        const socket = io('http://localhost:3001');

        axios.get(apiUrl)
            .then(response => {
                setQueue(response.data);
                if (response.data.data && response.data.data.length > 0) {
                    setName(response.data.data[0].name);
                    setUniqueNumber(response.data.data[0].uniqueNumber);
                }
            })
            .catch(error => {
                console.error('Error fetching reception queue data:', error);
            });

        // Listen for updates from the server and update the state accordingly
        socket.on('queueUpdate', updatedQueue => {
            setQueue(updatedQueue);
            if (updatedQueue.data && updatedQueue.data.length > 0) {
                setName(updatedQueue.data[0].name);
                setUniqueNumber(updatedQueue.data[0].uniqueNumber);
            }
        });

        // Clean up the socket connection when the component is unmounted
        return () => {
            socket.disconnect();
        };
    }, []); // Empty dependency array to run the effect only once

    return (
        <div className='allPage'>
            <div className='queuesCont'>
                <div className='queueDetails'>
                    <div className='currentPatient'>
                        <div className='patientNumber'>{uniqueNumber}</div>
                        <div className='patientName'>{name}</div>
                    </div>
                    <div className='nextPatient'>
                        <span className='queueDetTitle'>מטופל הבא: </span>
                        <div className='nextPatientName'>
                            {queue.data && queue.data.length > 0 ? queue.data[1].name : ''}
                        </div>
                    </div>
                </div>
                <div className='allQueues'>
                    <div className='queuesList'>
                        <div className="moveQueue">
                            <MedicalServicesIcon className='queueIcon' />
                            <span>העבר לחדר רופא</span>
                        </div>
                        <div className="moveQueue">
                            <VaccinesIcon className='queueIcon' />
                            <span>העבר לחדר טיפולים</span>
                        </div>
                        <div className="moveQueue">
                            <ZoomOutMapIcon className='queueIcon' />
                            <span>העבר לחדר טריאג</span>
                        </div>
                        <div className="moveQueue">
                            <MonitorHeartIcon className='queueIcon' />
                            <span>העבר לחדר אקג</span>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Queues;
